import React from 'react';
import { Button } from './Button';

export function Form(props) {

  return (
    <div>
      <form>
        <h4>{props.title}</h4>
        <label>Name:</label>
        <input type="text" placeholder="name" name="name" onChange={props.onChangeInput} />
        <label>Model:</label>
        <input type="text" placeholder="model" name="model" onChange={props.onChangeInput} />
      </form>
      <Button labelBtn="Save" handleBtn={props.addItem} />
    </div>
  )

}
